router.get('/wallet/:address', (req, res) => {
  console.log('Fetch user', req.params)
  const address = req.params.address

  User.findOne({ wallet: address })
    .exec()
    .then(r => {
      console.log(r)
      res.status(200).json(r)
    })
    .catch(err => {
      console.log(err)
      res.status(500).json({ error: err })
    })
})


module.exports = router;


